import React from 'react';

const Home = () => {
	return (
		<div>
			
				<div className='row'>
					<h1>Hello, I am Manish Mallik!</h1>
					<h3>I am a computer science major at the University of Texas at Dallas!</h3>
				</div>
			
		</div>
	);
};

export default Home;
